RT @GuiasArgentinas: 💗💗 Antes de que termine #OctubreRosa, recordá todas las acciones que permiten prevenir el cáncer de mama. 

📆 Programá tus chequeos ginecológicos (y todos tus chequeos médicos) y respetá la periodicidad indicada. 

@FundacionAvon @LalcecArgentina https://t.co/k3Jqy5BheV

